import React from "react";

const MarsFormII = props => {
  return (
    <div>
      <form>
        <h2> Can you breathe underwater longer than 1 minute? </h2>
        <br />
        <label htmlFor="yes"> Yes </label>
        <input type="radio" id="yes" name="breath" value="yes" />
        <label htmlFor="No"> No </label>
        <input type="radio" id="No" name="breath" value="No" />
        <label htmlFor="No"> No </label>
        <input type="radio" id="No" name="breath" value="No" />
      </form>
    </div>
  );
};

export default MarsFormII;
